import React from "react";
import Navigation from "./maincontent/Navigation";
import Hero from "./maincontent/Hero";


const Home = () =>{
    return(
        <div>
            <Navigation /> 
            <Hero/>
            <div className="container">
                <div className="row">
                    <div className="col-12 text-center my-5">
                        <h1>News</h1>
                    </div>
                    <div></div>
                </div>
            </div>
        </div>
    );
}

export default Home;
